import React, { useState, useEffect } from "react";
import Details from './Details'
const Commits = ({ url, user, repo, getReady, getReady2, getReady3 }) => {
    const [commits, setCommits] = useState('')

    useEffect(() => {
        (async() => {
            const result = await fetch(url)
	        const repos = await result.json()

            setCommits(repos)
        })()
    }, [url])

    return(
        <div>
            <h3>Los commits son:</h3>

            {commits.length > 0 ? 

            (<div >
                { console.log(commits)}
                {getReady2(commits[0].url.replace('commits', 'git/trees') + "?recursive=1", false)}

                {commits.map((commit, index) => {
                    return (
                    <div key = { index }>
                        <h4>{commit.commit.message}</h4>
                    </div> )})}
                    <Details user = { user } repo = { repo } url = { commits[0].url.replace('commits', 'git/trees') + "?recursive=1" } getReady2 = { getReady2} getReady3 = { getReady3 }/>
                    <button onClick= { getReady2(commits[0].url.replace('commits', 'git/trees') + "?recursive=1") } >See commits!</button>
            </div> 

            )
            :
            <p>El usuario no tiene repositorios</p>
            }
            <button onClick = { getReady("", "", true)}>Back</button>
        </div>
    )
}


export default Commits
